-- ----------------------------
-- View structure for gp_cab_entries
-- ----------------------------
DROP VIEW IF EXISTS `gp_cab_entries`;
CREATE ALGORITHM=UNDEFINED DEFINER=`gpadmin`@`localhost` SQL SECURITY DEFINER  VIEW `gp_cab_entries` AS SELECT
	`a`.`file_id` AS `entry_id`,
	`a`.`cabinet_id` AS `cabinet_id`,
	`a`.`source_id` AS `source_id`,
	`a`.`folder_id` AS `folder_pid`,
	`a`.`hash_code` AS `hash_code`,
	'FILE' AS `entry_type`,
	`a`.`owner` AS `owner`,
	`a`.`descr` AS `descr`,
	`a`.`file_name` AS `entry_name`,
	`a`.`acl_id` AS `acl_id`,
	`a`.`owm` AS `owm`,
	`a`.`creator` AS `creator`,
	`a`.`create_time` AS `create_time`,
	`a`.`modifier` AS `modifier`,
	`a`.`last_modified` AS `last_modified`,
	`a`.`classification` AS `classification`,
	`a`.`profile` AS `profile`,
	`a`.`properties` AS `properties`,
	`a`.`size` AS `size`,
	`a`.`comment_on` AS `comment_on`,
	`a`.`version` AS `version`,
	`a`.`version_label` AS `version_label`,
	`a`.`state` AS `state`,
	`a`.`format` AS `format`,
	`a`.`binary_id` AS `binary_id`,
	0 AS `file_count`,
	0 AS `folder_count`
FROM
	`gp_cab_files` `a`
UNION
	SELECT
		`b`.`folder_id` AS `entry_id`,
		`b`.`cabinet_id` AS `cabinet_id`,
		`b`.`source_id` AS `source_id`,
		`b`.`folder_pid` AS `folder_pid`,
		`b`.`hash_code` AS `hash_code`,
		'FOLDER' AS `entry_type`,
		`b`.`owner` AS `owner`,
		`b`.`descr` AS `descr`,
		`b`.`folder_name` AS `entry_name`,
		`b`.`acl_id` AS `acl_id`,
		`b`.`owm` AS `owm`,
		`b`.`creator` AS `creator`,
		`b`.`create_time` AS `create_time`,
		`b`.`modifier` AS `modifier`,
		`b`.`last_modified` AS `last_modified`,
		`b`.`classification` AS `classification`,
		`b`.`profile` AS `profile`,
		`b`.`properties` AS `properties`,
		`b`.`total_size` AS `size`,
		0 AS `comment_on`,
		'' AS `version`,
		'' AS `version_label`,
		'' AS `state`,
		'' AS `format`,
		0 AS `binary_id`,
		`b`.`file_count` AS `file_count`,
		`b`.`folder_count` AS `folder_count`
	FROM
		`gp_cab_folders` `b` ;

-- ----------------------------
-- View structure for gp_msg_dispatch
-- ----------------------------
DROP VIEW IF EXISTS `gp_msg_dispatch`;
CREATE ALGORITHM=UNDEFINED DEFINER=`gpadmin`@`localhost`  VIEW `gp_msg_dispatch` AS select 
msgs.chat_id,
msgs.message_id,
msgs.msg_type,
msgs.msg_content,
msgs.send_time,
msgs.sender,
msgs.resource_id,
msgs.resource_type,
disp.receiver,
disp.touch_flag,
disp.touch_time,
rcvs.full_name as rcv_name,
sdrs.full_name as send_name
from gp_chat_dispatch disp
left join gp_chat_msgs msgs on msgs.message_id = disp.message_id
left join (select account,full_name from gp_users) sdrs on msgs.sender = sdrs.account
left join (select account,full_name from gp_users) rcvs on disp.receiver = rcvs.account ;

