-- View structure for gp_orghier_mbrs
-- ----------------------------
DROP VIEW IF EXISTS `gp_orghier_mbrs`;
CREATE ALGORITHM=UNDEFINED DEFINER=`gpadmin`@`localhost` SQL SECURITY DEFINER  VIEW `gp_orghier_mbrs` AS SELECT
	gusr.group_id AS group_id,
	grp.manage_id AS manage_id,
	gusr.rel_id AS mbr_rel_id,
	grp.group_name AS group_name,
	grp.group_type AS group_type,
	grp.descr AS group_descr,
	gusr.account AS account,
	gusr.role AS role,
	usr.user_id AS user_id,
	usr.create_time AS create_time,
	usr.email AS email,
	usr.full_name AS full_name,
	usr.classification AS classification,
	usr.type AS user_type,
	setting.post_visible AS post_visible,
	src.source_id AS source_id,
	src.source_name AS source_name
FROM
	gp_group_user gusr
	LEFT JOIN gp_groups grp ON (
			grp.group_id = gusr.group_id
	)
	LEFT JOIN (
				SELECT
					gp_users.user_id AS user_id,
					gp_users.account AS account,
					gp_users.create_time AS create_time,
					gp_users.email AS email,
					gp_users.full_name AS full_name,
					gp_users.type AS type,
					gp_users.classification AS classification,
					gp_users.source_id AS source_id
				FROM
					gp_users
			) usr ON (
				(
					usr.account = gusr.account
				)
			)
	LEFT JOIN (
			SELECT
				gp_sources.source_id AS source_id,
				gp_sources.source_name AS source_name
			FROM
				gp_sources
		) src ON (
			(
				src.source_id = usr.source_id
			)
		)
	LEFT JOIN gp_mbr_setting setting ON (
			grp.manage_id = setting.manage_id AND
			gusr.account = setting.account AND
			setting.group_type = 'ORG_HIER_MBR'
	)
WHERE
	(
		grp.group_type = 'ORG_HIER_MBR'
	) ;

