DROP PROCEDURE IF EXISTS `proc_wgroup_route`;
DELIMITER ;;
CREATE DEFINER=`gpadmin`@`localhost` PROCEDURE `proc_wgroup_route`(in `p_wgroup_id` integer, out `route_ids` varchar(2048))
BEGIN
	
