;;
DELIMITER ;

-- ----------------------------
-- Function structure for func_split_str
-- ----------------------------
DROP FUNCTION IF EXISTS `func_split_str`;
DELIMITER ;;
CREATE DEFINER=`gpadmin`@`localhost` FUNCTION `func_split_str`(x VARCHAR(255),
  delim VARCHAR(12),
  pos INT) RETURNS varchar(255) CHARSET utf8
BEGIN
RETURN REPLACE(
	SUBSTRING(
		SUBSTRING_INDEX(x, delim, pos + 1),
       LENGTH(SUBSTRING_INDEX(x, delim, pos)) + 1),
       delim, '');
END
;;
DELIMITER ;
